-- Dumping structure for procedure database_2031119.SearchTheOrders
DELIMITER //
CREATE PROCEDURE `SearchTheOrders`(
	IN `c_customer_id` CHAR(36),
	IN `created_date` DATE
)
BEGIN
# CREATED BY					DATE					COMMENTS
#AKSHAR PATEL(2031119)		03 APRIL,2022		CREATED THE PROCEDURES
#AKSHAR PATEL(2031119)		22 APRIL,2022		GRANT PERMISSION
# this procedure is used to search the data among the tables like orders,
# products and customers.
# we have join the tables orders and products on product_id 
# and moreover, i have also joined customers and orders on customer_id
# we have also used where condition to compare
# customers customer_id and entered customer_id
# and where orders created date is greater then entered created date.
	SELECT orders.order_id,orders.created, products.productCode, customers.firstname, 
				customers.lastname, customers.city, orders.comments, orders.sellingPrice, 
				orders.quantitySold, orders.subtotal, orders.taxamount, orders.total 
	FROM orders
				JOIN products 
				ON orders.product_id = products.product_id
				JOIN customers 
				ON orders.customer_id = customers.customer_id 
	WHERE customers.customer_id = c_customer_id 
	AND orders.created >= created_date;
END//
DELIMITER ;

